import React from 'react'

import UserList from './components/UserList/UserList'

function App() {
  const userData = [
    { name: 'Max', age: 31 },
    { name: 'Alex', age: 27 },
    { name: 'Victor', age: 40 },
  ]

  return (
    <div>
      <UserList userData={userData} />
    </div>
  )
}

export default App
